module.exports = "<section id=\"about\" xmlns=\"http://www.w3.org/1999/html\">\n  <div class=\"container\">\n      <div class=\"row\">\n          <div class=\"col-sm-6\">\n              <h4>Django Fest</h4>\n              <h5>\n                  If you want to learn how to make websites, we have good news for you: we are holding a free workshop for beginners! It will take place January 27, 2024.\n                  <a href=\"http://kcwomenintech.org\" target=\"_blank\">Kansas City Women in Technology's</a> ongoing mission is to grow the number of women in technology careers in Kansas City.\n              </h5>\n              <h5>\n                  KCWiT is excited to introduce people to coding and technology through this Django workshop. We want to give you an opportunity to learn how to program! This workshop is free of charge, and some meals will be provided.\n              </h5>\n          </div>\n          <div class=\"col-sm-6 mt-5\">\n              <h4>Schedule</h4>\n              <h5>January 27th, 2024</h5>\n              <ul>\n                  <li>8:30 - 9:00 am Attendee check-in</li>\n                  <li>9:00 - 9:15 am Opening presentation &amp; kickoff, light breakfast</li>\n                  <li>9:15 am - 12:30 pm Session</li>\n                  <li>12:30 - 1:30 pm Lunch break</li>\n                  <li>1:30 - 5:00 pm Session</li>\n                  <li>5:00 - 5:30 pm Closing presentation, retrospective</li>\n              </ul>\n          </div>\n      </div>\n  </div>\n  </section>\n\n<section id=\"faq\">\n  <div class=\"faq-img\"></div>\n  <div class=\"container\">\n      <h4 class=\"text-center\">FAQ</h4>\n      <h5>Don't see an answer to your question below? Please contact us at <a href=\"mailto:djangofest@kcwomenintech.org?Subject=DjangoFestKC%Inquiry\" target=\"_blank\">djangofest@kcwomenintech.org</a>!</h5>\n      <div class=\"row\">\n          <div class=\"col-md-4 text-left\">\n              <p><b>Do I need to know anything about websites or programming?</b></p>\n              <p>No! Workshops are for beginners. You donâ€™t need to know anything about it. However, if you have a little bit of technical knowledge (i.e. you know what HTML or CSS are) you still can apply!</p>\n          </div>\n          <div class=\"col-md-4 text-left\">\n              <p><b>Do I need to have something installed on my laptop?</b></p>\n              <p>\n                  It would be helpful to have Django installed before workshops, but we wouldn't expect you to install anything on your own.\n              </p>\n          </div>\n      </div>\n      <div class=\"row\" style=\"margin-top: 30px;\">\n          <div class=\"col-md-4 text-left\">\n              <p><b>I don't live in Kansas City, can I attend?</b></p>\n              <p>Of course! Groups of women from Omaha and Oklahoma City have joined us in prior years.</p>\n          </div>\n          <div class=\"col-md-4 text-left\">\n              <p><b>Is food provided? </b></p>\n              <p>Yes. Thanks to our sponsors, lunch will be provided during workshops.</p>\n          </div>\n          <div class=\"col-md-4 text-left\">\n                <p><b>Who can attend?</b></p>\n                <p>Anyone ages 14 and up.</p>\n          </div>\n          <div class=\"col-md-4 text-left\">\n            <p><b>I do not live in Kansas City. Can I still attend?</b></p>\n            <p>Definitely! You will be responsible for lodging and transportation.</p>\n      </div>\n      </div>\n  </div>\n</section>\n\n\n<section id=\"apply\" name=\"#signup\">\n  <div class=\"container\">\n      <div class=\"row\">\n          <div class=\"col-sm-12\">\n              <h4 class=\"text-center\">Apply today!</h4>\n              <p class=\"text-center\">\n                    Mentor applications open soon!<br />\n                  Apply to be a mentor here:<br />\n                  <a class=\"btn btn-light\" href=\"https://forms.gle/s1q3xPFBqSKB9C5BA\" target=\"_blank\" role=\"button\">Mentor Application</a>\n              </p>\n              <p class=\"text-center\">\n                  Apply to be an attendee here:<br />\n                  <a class=\"btn btn-light\" href=\"https://forms.gle/n6Z4AX3w7p5kqpMW6\" target=\"_blank\" role=\"button\">Attendee Application</a>\n              </p>\n          </div>\n      </div>\n  </div>\n</section>\n\n<section id=\"sponsors\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <h4 class=\"text-left\">Sponsors</h4>\n      <p class=\"text-left\">\n          We couldn't be here without the support from amazing organizations and people who donated money, knowledge, and time to help us make this a reality. If you want to contribute and support our goal, please get in touch at djangofest@kcwomenintech.org!\n      </p>\n    </div>\n  </div>\n</section>\n\n<section id=\"team\">\n  <div class=\"container\">\n      <div class=\"row\">\n          <div class=\"col-sm-1\"></div>\n          <div class=\"col-sm-10\">\n              <h4>Meet the Team</h4>\n          </div>\n          <div class=\"col-sm-1\"></div>\n      </div>\n      <div class=\"row\">\n          <div class=\"col-sm-3 team-member\" *ngFor=\"let member of team\">\n              <img class=\"rounded-circle\" src=\"{{member.img}}\" alt=\"{{member.name}}\" />\n              <h6>{{member.name}}</h6>\n              <p>{{member.title}}</p>\n          </div>\n      </div>\n  </div>\n</section>\n\n<section id=\"mentor\">\n  <div class=\"container\">\n      <div class=\"row\">\n          <div class=\"col-sm-1\"></div>\n          <div class=\"col-sm-10\">\n              <p class=\"text-center\">\n                Apply to be a mentor here:<br />\n              </p>\n                  <a class=\"btn btn-light\" href=\"https://forms.gle/s1q3xPFBqSKB9C5BA\" target=\"_blank\" role=\"button\">Mentor Application</a>\n          </div>\n          <div class=\"col-sm-1\"></div>\n      </div>\n      \n      <!-- <div class=\"row mt-5\">\n          <div class=\"col-md-3 md-offset-1\">\n              <span>\n                <img src=\"/assets/images/mentors/alisa.png.160x160_q85_crop-smart.png\" class=\"coach\" />\n            </span>\n              <br /> Alisa Duncan\n              <br />\n              <a href=\"https://twitter.com/AlisaDuncan\" target=\"_blank\">@AlisaDuncan</a><br />\n          </div>\n          <div class=\"col-md-3\">\n              <span>\n                <img src=\"/assets/images/mentors/Alysha.jpg.160x160_q85_crop-smart.jpg\" class=\"coach\" />\n            </span>\n              <br /> Alysha Williams\n              <br />\n          </div>\n          <div class=\"col-md-3\">\n              <span>\n                <img src=\"/assets/images/mentors/andie.jpg.160x160_q85_crop-smart.jpg\" class=\"coach\" />\n            </span>\n              <br /> Andie Johnson\n              <br />\n          </div>\n          <div class=\"col-md-3\">\n              <span>\n                <img src=\"/assets/images/mentors/Ben.jpg.160x160_q85_crop-smart.jpg\" class=\"coach\" />\n            </span>\n              <br /> Ben Rodriguez\n              <br />\n              <a href=\"https://twitter.com/benlovesnachos\" target=\"_blank\">@benlovesnachos</a><br />\n          </div> -->\n      <!-- </div> -->\n  </div>\n</section>\n\n"

